Advertising executive Eddie Anderson has success in business, comfort in marriage...and a gnawing despair he can't escape. So one morning he turns his sports car into the path of an 18-wheeler on the freeway - and toward a tumultuous future.

Writer/director Elisa Kazan cast this riveting film version of his bestseller with top-flight actors who capture all the book's passions and nerve-ends. Kirk Douglas as Eddie, Faye Dunaway as his provocative mistress, Deborah Kerr as his uncomprehending wife, Richard Boone as his tyrannical father and Hume Cronyn as a manipulative family attorney all give performances of truth and power. Bold. Insightful. Carnal. The Arrangement is for everyone who's reached for the brass ring
and came up with his/her own arrangement.

